import React from "react"
import ProjectCard from './ProjectCard.js'
import './App.css';
import art from './images/art.png'
import rem from './images/rem.png'
import luk from './images/luk.jpeg'
import merlot from './images/merlot.jpeg'

const projects = [
    {link:"/proj1", image:art, title:"art", category:"film"},
    {link:"/proj2", image:rem, title:"rem", category:"film"},
    {link:"/proj3", image:eop, title:"eop", category:"film"},
    {link:"/proj4", image:rem, title:"rem", category:"film"}
]

function renderList(items) {
    var list = items.map(item => { 
      return <ProjectCard link={item.link} image = {item.image} title={item.title} category={item.catergory}/>
    });
    return list;
  }


function Project(props) {
  return (
    <div>
      <h1>Project</h1>
      {renderList(projects)}

    </div>
  )
}


export default Project;
